import React from "react";
import userList from "../../data/userList";
import Card from "../Card/Card";

function UserList() {
  console.log(userList, userList[0].name);
  return (
    <div>
        {userList.map(user => {
          return <Card>
            <h1>{user.id}</h1>
            <div>{user.name}</div>
            <p>{user.address}</p>
          </Card>;
        })}
    </div>
  );
}

export default UserList;
